def replace_parentheses_with_brackets(text):
    """
    Replaces all parentheses in the input text with square brackets.

    Args:
        text (str): The input text with parentheses.

    Returns:
        str: Text with parentheses replaced by brackets.
    """
    return text.replace("(", "[").replace(")", "]")


